import { View, Text } from "react-native";
import {
  MagnifyingGlassIcon,
  AdjustmentsVerticalIcon,
  ArrowRightIcon,
} from "react-native-heroicons/outline";

const FeaturedRowComponent = (props) => {
  return (
    <View>
      <View>
        <Text>{props.title}</Text>
        <ArrowRightIcon />
      </View>
    </View>
  );
};

export default FeaturedRowComponent;
